function jsInicio(){
	var formx = document.form1;
	
	if(formx.tipo_doc != undefined)
		formx.tipo_doc.value = '';
	formx.criterio.value = '';
	formx.grupo.value = '4';
	formx.orden.value = 'fob';	
	
	
}


function jsBuscar(){
	var formx = window.document.form1;

	if(formx.fec_inicio.value == ''){
		alert('Ingrese la fecha de inicio de numeración');
		formx.fec_inicio.focus();
		return;
	}else if(!checkdateOperador(formx.fec_inicio.value)){
		alert('Formato de fecha incorrecto');
		formx.fec_inicio.focus();
		return false;			
	}
	
	if(formx.fec_fin.value == ''){
		alert('Ingrese la fecha de fin de numeración');
		formx.fec_fin.focus();
		return;
	}else if(!checkdateOperador(formx.fec_fin.value)){
		alert('Formato de fecha incorrecto');
		formx.fec_fin.focus();
		return false;			
	}
	
	if(comparafecha(formx.fec_inicio.value, formx.fec_fin.value) == 1){
		formx.fec_inicio.focus();
		alert('La fecha de inicio de numeración no puede ser mayor a la de fecha fin de numeración');
		return;
	}		
	if(formx.fec_inicio.value.substring(6,10) != formx.fec_fin.value.substring(6,10) ){
		formx.fec_fin.focus();
		alert('Solo se puede consultar para un mismo año');
		return;
	}
	
		if(formx.criterio.value == ''){
		alert('Seleccione el tipo de documento');
		formx.criterio.focus();
	return;
	}
	
	

	if(formx.grupo.value == ''){
		alert('Ingrese la clasificación');
		formx.grupo.focus();
		return;
	}

	if(formx.orden.value == ''){
		alert('Seleccione el orden de la consulta');
		formx.orden.focus();
		return;
	}
	
	if(!formx.donacion[0].checked && !formx.donacion[1].checked){
		alert('Seleccione el criterio de donación');
		formx.donacion[0].focus();
		return;
	}
	formx.accion.value = 'consultarImportador';
	formx.submit();
}
function jsLimpiar(){
	var formx = document.form1;
	formx.accion.value = 'cargarConsulta';
	formx.submit();
}

function jsDetalle(detalle,description, tipoDoc){
	//HAcostaR Fin - M_SNADE193-2 LEY DE PROTECCION DE DATOS PERSONALES	
	var formx = document.form1;
	formx.detalle.value=detalle;
	formx.description.value=description;
	formx.tipoDocum.value=tipoDoc;//HAcostaR - M_SNADE193-2 LEY DE PROTECCION DE DATOS PERSONALES
	formx.accion.value = 'consultarDetalleDuaImportador';
	formx.submit();
}


function jsExport(){
	var formx = document.form1;
	formx.target = '_parent';
	formx.accion.value = 'exportarImportador';
	formx.submit();
	formx.target = 'det';
}
